('642931d435', 'ABOUT', 'ID', 'APA ITU', 'MANTIKO GROUP INDONESIA', '<p>MANTIKO GROUP INDONESIA merupakan salah satu Holding company yang didirikan Oleh <strong>Fedri Ramadhani, SST, M.Par</strong> sejak tahun 2020.</p>\r\n<p>Memayungi beberapa unit usaha, yang bergerak di berbagai bidang, seperti Travel Agent, Event Organizer, Restoran dan Katering, Sentra Refleksi dan Massage, Dekorasi Wedding, Penyewaan Videotron, Sekolah Seni, Penyelenggaraan pelatihan dan Team Building.</p>\r\n<p>Mantiko Group Indonesia tersebar dibeberapa area di Jakarta dan Bali. Selain itu dengan karyawan mencapai 50 orang. Mantiko Group Indonesia terus berkembang se-iring dengan bertambahnya unit - unit usaha di berbagai industri di Indonesia.</p>', '', 'Mantiko Group Indonesia', 'Mantiko Group Indonesia', '', '642931d435dbd.png'),
