('64305113a4', 'FOSO', 'ID', 'FOUNDER STORY', '', '<p xss=removed>Fedri Ramadhani atau yang dikenal dengan Uda Fee adalah anak Bungsu dari 6 Bersaudara, Terlahir kembar dengan saudara laki lakinya bernama Fedra Ramadhan pada 12 Februari 1994.</p>\r\n<p xss=removed>Uda Fee lahir dari keluarga sederhana di Nagari Barulak, Kecamatan Tanjung Baru, Kabupaten Tanah Datar. Dari kecil menempuh pendidikan di sekolah agama, dan tumbuh hingga remaja sebagai seorang guru ngaji dan juga penyiar radio. Selain itu Uda Fee juga dikenal sebagai anak yang beprestasi, Dari SD hingga SMK selalu menjadi Juara Kelas bahkan prestasi di luar sekolah lebih dari 100 prestasi sudah dikantongi nya.</p>\r\n<p xss=removed>Setelah lulus dari Jurusan Usaha Perjalanan Wisata di SMKN 1 Tanjung Baru, Uda Fee berhasil lulus sebagai penerima beasiswa Bidikmisi untuk lanjut di Program DIV Manajemen Perhotelan FPP, Universitas Negeri Padang. Di sepanjang perkuliahan Fedri tidak hanya menghabiskan waktunya di Kampus saja, Dya juga bekerja di Salah satu Top Agent Sriwijaya Air , PT.KETAPING JAYA SAKTI, Padang. Selain itu juga aktif lebih dari 8 Organisasi, salah satunya adalah Ketua Umum Nasional Himpunan Mahasiswa Pariwisata Indonesia (HMPI).</p>', '<p xss=removed>Pada Tahun 2016, Uda Fee Lulus dengan IPK Cumlaude 3.81 dan melanjutkan karirnya menjadi Marketing Communication di Grand Zuri Hotel Padang, dan tak lama setelah itu Fedri mendapatkan kesempatan untuk dapat bekerja di Hotel Aston Marina Ancol, Jakarta sebagai Sales Executive, Dan terus naik hingga akhirnya menjabat sebagai Director Of Sales & Marketing di NIRA GROUP Jakarta.</p>\r\n<p xss=removed>Sembari meniti karir, Uda Fee juga berhasil menerima beasiswa S2 di Master of Tourism STP Trisakti Jakarta pada tahun 2019. Sambil menjadi freelancer sebagai News Anchor di TVRI DKI Jakarta.</p>\r\n<p xss=removed>Perjalanan panjang uda Fee memang tidak bisa dikatakan mulus begitu saja, ketika Pandemi masuk di 2020, Uda Fee terpaksa di rumahkan oleh perusahaanya karena terdampak parah. Dengan pesangon yang ada, Dia mencoba bertahan di Ibukota dengan Berjualan Sepatu. Namun karena peminat tak begitu banyak,bdan daya beli turun karena pandemi, Tak lama kemudian membuka sebuah Rumah Makan Padang berbentuk UMKM di Jakarta Pusat diberi nama D\'Kapau Nusantara. Dan terus berkembang menjadi beberapa cabang.</p>\r\n<p xss=removed>Seiring waktu berjalan Uda Fee memutuskan untuk menbangun usaha lainnya seperti Laundry (Travelaundry), Klinik Refleksi dan Massage (KAKOTO Refleksi & Massage), Dekorasi dan Wedding Organizer (UF Enterprise & Wedding Organizer), Perusahaan penyedia multimedia (CV.VIDTRON MULTIMEDIA INDOTAMA), Travel agent dan Event Organizer (MANTIKO Travel and MICE Services), serta Sekolah Seni (MGI Academy).</p>\r\n<p xss=removed>Untuk menjaga stabilitas operasional dan mempertegas payung hukum dalam perizinan perushaan, Uda Fee bersama saudara kembarnya membangun sebuah perusahaan Induk Holding Company yang diberi nama MANTIKO GROUP INDONESIA. Dibawah naungan PT.MANTIKO ALAM INDONESIA. Yang memayungi 6 unit usaha bergerak di berbagai bidang. Nama Mantiko sendiri di ambil dari nama Almarhum Kakek dari uda Fee \"Datuak Mantiko Alam\".</p>\r\n<p xss=removed>Perusahaan yang memiliki visi sosial ini diharapkan dapat membantu siapa saja yang membutuhkan, terkhusus Para penggaguran daerah untuk dapat berkembang di Ibukota dan memgangkat derajat keluarganya. Kini Mantiko Group Indonesia memiliki lebih dari 30 Karyawan, dan berasal dari kalangan Ibu single fighter, Dhuafa, Dan Generasi Muda Freshgraduated dari berbahagai daerah di Indonesia.</p>', 'Fedri Ramadhani', 'Fedri Ramadhani', '', '64305113a4535.png'),
