INSERT INTO `ct_page` (`page_id`, `product_id`, `subpage`, `lang`, `title`, `subtitle`, `description`, `description2`, `meta_title`, `meta_description`, `URL`, `image`) VALUES
('642dd485b4', 1, 'ABT', 'ID', 'Mantiko Travel & Mice', '', '<p>Mantiko Travel & Mice adalah travel agent berkembang yang berada di dalam naungan PT Mantiko Alam Indonesia. Didirkan oleh <strong>Fedri Ramadhani SST,M.Par</strong>, seorang public figure berdarah minang berdomisili Jakarta</p>\r\n<p>Mantiko dibentuk dari kecintaannya menjadi pemandu wisata muda dari tahun 2010. Fedri memantapkan dirinya dengan melanjutkan pendidikan level SLTA hingga S2 dibidang parawisata Sehingga berdirilah Mantiko Travel & MICE sebagai bentuk pengaplikasian ilmu dan pengalamannya di dunia kerja maupun di akademik.</p>', '<p>Sebagai sebuah perusahaan yang berada didalam naungan Mantiko Group Indonesia, kami hadir dengan konsep milenial modern dan siap bersaing dengan travel agent besar lainnya di Jakarta. Mengutamakan produk - produk kekinian dan go digital. dengan target 1000 event / tour per tahunnya.  </p>', 'Mantiko Travel & Mice', 'Mantiko Travel & Mice', '', '642dd485b461d.png'),
('642dd4adb6', 1, 'PRD', 'ID', 'TIKET, TOUR & TRANSPORTASI ', '', '<p>Kami menyediakan berbagai paket tour untuk berbagai kebutuhan, seperti incentive tour, Study Tour, Family Tour, Private Tour, Honey-moon Tour, dan paket tour lainnya, baik di destinasi alam, sejarah dan budaya dan permintaan khusus lain.</p>', '', 'Tiket Tour & Transportasi', 'Mantiko Travel & Mice menyediakan Paket Tour & Transportasi', '', '642dd4adb66be.png'),
('642dd5122a', 1, 'PRD', 'ID', 'SEMINAR KIT', '', '<p>Seminar kit adalah souvenir yang diberikan oleh suatu event, sebagai kenang-kenangan yang dapat membuat audiens mengingat kembali event tersebut</p>', '', 'Seminar Kit', 'Seminar Kit', '', '642dd5122a5a2.jpg'),
