('642e56844d', 2, 'ABT', 'ID', 'Vidtron Multimedia Indotama', '', '<p>Perusahaan yang didirikan pada tanggal 27 Mei 2022 ini menyediakan jasa penyewaan peralatan LED Videotron indoor dan outdoor, panggung, lighting, dan backdrope photoboth. Bukan hanya itu saja, kami juga sekaligus bisa menerima jasa editing seperti virtual background, bumper, frame, thirdlow, dan berbagai jenis desain lainnya yang dibutuhkan untuk keperluan meeting atau event-event lainnya.</p>', '', 'Vidtron Multimedia Indotama', 'Vidtron Multimedia Indotama', '', '642e56844dc56.png'),
('642e591ca1', 2, 'PRD', 'ID', 'VIRTUAL MEETING', '', '<p>Kegiatan pertemuan yang dibuat secara online dan dibantu dengan berbagai meeting tools yang lengkap dengan crew yang profesional. Kami akan membuat kegiatan diskusi, seminar, teleconfrence dan meeting</p>', '', 'VIRTUAL MEETING', 'VIRTUAL MEETING', '', '642e591ca1.png'),
('642f0fa969', 2, 'PRD', 'ID', 'BACKDROP PHOTOBOTH', '', '<p>Kami menyediakan berbagai jenis photoboth, mulai dari backdrop photoboth, photoboth custom, spin 360 dan videobooth.</p>', '', '', '', '', '642f0fa969.png'),
('642f103be3', 2, 'PRD', 'ID', 'LIGHTING', '', '<p>Jenis - jenis pencahayaan yang kamu miliki dapat menerangi dan menyorot objek utama di panggung. Dan warna-warni dari lighting yang kami punya akan menghiasi panggung dan menjadikan suatu event menjadi menarik</p>', '', 'Lighting', 'Lighting', '', '642f103be3.jpg'),
