('642f15fe00', 3, 'ABT', 'ID', 'MGI Academy', '', '<p>Sebuah sekolah seni yang didirikan pada tanggal 5 November 2022. MGI Academy bertujuan untuk menghasilkan SDM yang ahli dibidang seni khususnya seperti seni tari, musik dan vocal, motivator dan trainer</p>', '', 'MGI Academy', 'MGI Academy', '', '642f15fe009d1.png'),
('642f2ba3bf', 3, 'PRD', 'ID', 'TIM BUILDING', '', '<p>Team kami akan menyuguhkan berbagai macam permainan yang bisa membangun kerjasama dan keakraban antar peserta team building. Tujuan team building ini akan membangkitkan rasa peduli, saling memberi, saling menghargai, dan saling memberi apresisasi </p>', '', 'TIM BUILDING', 'TIM BUILDING', '', '642f2ba3bfe46.png'),
('642ff279c4', 3, 'TIM', 'ID', 'Tisya Laura Dewi, S.Pd', '', '<p>Lulusan Fakultas Bahasa dan Seni, Universitas Negeri Padang. </p>\r\n<p>Merupakan Pemenang Putri Pariwisata Indonesia 2021. Yang meraih gelar Putri Pariwisata Indonesia 2021 dan Putri Pariwisata Indonesia Multitalented 2021. Delegasi Indonesia dalam Festival Tari & Teknologi Asia 2019 di Malaysia dan Smotra Folklora 2017 at Zagreb, Croatia.</p>\r\n<p>Hingga saat ini Laura sudah memiliki lebih dari 100 tropi juara 1 dalam perlombaan tari. She also an influencer with 11k followers on instagram.</p>\r\n<p>Additional skills : Communication, public speaking, host, presenter, Master of Ceremony.</p>', '', '', '', '', '642ff279c4.png'),
('642ff2db30', 3, 'TIM', 'ID', 'Putri Varianda, S.Sn', '', '<p>Seniman.</p>\r\n<p>Lulusan Strata satu seni tari,</p>\r\n<p>Fakultas seni pertunjukan, Institut seni Indonesia Padang Panjang.</p>\r\n<p>Delegasi Indonesia perwakilan Sumatera barat dalam acara Indonesia Festival di Rumania dan seoul, Korea selatan. ikut terlibat dalam “MUSIKAL NURBAYA “ oleh GALERI INDONESIA KAYA</p>', '', '', '', '', '642ff2db30.png'),
('642ff5c0d7', 3, 'TIM', 'ID', 'Sony Prosky', '', '<p>Influencer</p>\r\n<p>Jebolan ajang seni di beberapa TV Swasta Indonesia, Dan Delegasi Indonesia pada Festival Seni Dubai. Dan juga penari di istana presiden dalam rangka penyambutan presiden singapore</p>', '', '', '', '', '642ff5c0d7.png'),
('642ff5f085', 3, 'TIM', 'ID', 'Yola Afriani Caniago S,Sn', '', '<p>Lulusan strata satu seni tari, institut seni indonesia </p>\r\n<p>Seniman dan pegawai swasta </p>\r\n<p>Penari dalam pertukaran budaya indonesia untuk prancis di ajang FCI culture 2018 di paris,france. </p>\r\n<p>Pemateri workshop kuliner dan penari di ajang pertukaran budaya malaysia dan indonesia pada event cultural exchange of traditional culinary heritage di kuala lumpur malaysia. </p>', '', '', '', '', '642ff5f085.png'),
('642ff60897', 3, 'TIM', 'ID', 'Triana Suryati S.ST', '', '<p>Lulusan S1 Managemen Perhotelan di Universitas Negeri Padang. Delegasi Indonesia di  beberapa Event Seni/Budaya Internasional di beberapa negara seperti Malaysa, Singapura, Afrika, Belanda, dan negara-negara Eropa.</p>', '', '', '', '', '642ff60897.png'),
('64300721b7', NULL, 'ABT', 'ID', 'KAKOTO ', '', '<pre class=\"a-b-r-La\" xss=removed><span xss=removed><span xss=removed>Perusahaan reflexology and massage yang di didirikan pada tanggal 12 Juli 2022.\r\nKami melayani refleksi kaki, full body massage, totok wajah, bekam dan berbagai jenis treatment lainnya.<br>Kakoto Hadir dengan konsep Super Modern Dan Cocok untuk treatment kesehatan berbagai kalangan baik untuk anak Muda ataupun Dewasa. Dengan Fasilitas Luxury dan kekinian, Kakoto mampu bersaing dengan sentra refleksi di Jakarta. Terlebih dengan Tenaga Terapist Berpengalaman dan Bersertifikat Professional.</span></span></pre>', '<p>KAKOTO menghadirkan Nuansa Jepang, Dengan beragam keunggulan, Seperti ruangan yang nyaman, Pilihan Terapist Pria atau Wanita, Promosi bersaing, hingga fasilitas snack tambahan yang siap menemani para pelanggan ketika melakukan treatment ke Kakoto.</p>', 'KAKOTO ', 'KAKOTO', '', '64300721b749f.png'),
('643007633d', 5, 'ABT', 'ID', 'KAKOTO ', '', '<p>Perusahaan reflexology and massage yang di didirikan pada tanggal 12 Juli 2022. Kami melayani refleksi kaki, full body massage, totok wajah, bekam dan berbagai jenis treatment lainnya.<br>Kakoto Hadir dengan konsep Super Modern Dan Cocok untuk treatment kesehatan berbagai kalangan baik untuk anak Muda ataupun Dewasa. Dengan Fasilitas Luxury dan kekinian, Kakoto mampu bersaing dengan sentra refleksi di Jakarta. Terlebih dengan Tenaga Terapist Berpengalaman dan Bersertifikat Professional.</p>', '<p>Kakoto Hadir dengan konsep Super Modern Dan Cocok untuk treatment kesehatan berbagai kalangan baik untuk anak Muda ataupun Dewasa.</p>\r\n<p>Dengan Fasilitas Luxury dan kekinian, Kakoto mampu bersaing dengan sentra refleksi di Jakarta. Terlebih dengan Tenaga Terapist Berpengalaman dan Bersertifikat Professional.</p>\r\n<p>KAKOTO menghadirkan Nuansa Jepang, Dengan beragam keunggulan, Seperti ruangan yang nyaman, Pilihan Terapist Pria atau Wanita, Promosi bersaing, hingga fasilitas snack tambahan yang siap menemani para pelanggan ketika melakukan treatment ke Kakoto.</p>', 'KAKOTO ', 'KAKOTO', '', '643007633d455.png'),
('64300897b6', 5, 'PRD', 'ID', 'REFLEXY', '', '<p>Pijit reflexy merupakan metode pijit atau urut yang berfokus pada titik di bagian kaki,tangan dqn telinga.</p>', '', 'Pijat Refleksi', 'Pijat Refleksi', '', '64300897b68ab.png'),
('643008d976', 5, 'PRD', 'ID', 'FULL BODY MASSAGE ', '', '<p>Full body masage ini dapat meredakan rasa nyeri punggun,meningkatkan kualitas tidur hingga melawan rasa letih.</p>', '', 'Fully Body Massage', 'Fully Body Massage', '', '643008d9763a9.png'),
('6430090e65', 5, 'PRD', 'ID', 'THAI MASSAGE', '', '<p>Thai massage menggunakan teknik peregangan,penarikandan gerakan seperti yoga.manfaatnya untuk meredakan sakit kepala,mengurangi sakit punggung,meredakan nyeri sendi dan otot dll.</p>', '', 'THAI MASSAGE', 'THAI MASSAGE', '', '6430090e65238.png'),
('6430380895', 5, 'PRD', 'ID', 'TOTOK WAJAH ', '', '<p>merupakan metode pengobatan dengan memberikan tekanan di titik titik tertentu pada wajah dan memberikan manfaat bagi kesehatan dan kecentikan.</p>', '', 'Totok Wajah', 'Totok Wajah', '', '6430380895.jpeg'),
('643038374e', 5, 'PRD', 'ID', 'LULUR ', '', '<p>Bermanfaat untuk mengangkat sel kulit mati yang akan terlihat kusam dan membuat kulit lebih cerah.</p>', '', 'LULUR ', 'LULUR ', '', '643038374e.jpg'),
('6430385caa', 5, 'PRD', 'ID', 'HOT STONE', '', '<p>Merupakan terapi pijit menggunakan batu panas yang bertujuan meredakan otot tegang lebih rileksdan memperbaiki jaringan yang rusak di tubuh.</p>', '', 'Hot Stone', 'Hot Stone', '', '6430385caa.jpg'),
('6430389187', 5, 'PRD', 'ID', 'BEKAM', '', '<p>adalah suatu metode  pemgobatan yang dilakukan dengan cara menyedot keluar darah kotor manfaatny adalah membuang racun, angin, kolestrol, melancarkan peredaran darah serta mengatasi demam.</p>', '', 'Bekam', 'Bekam', '', '6430389187.jpg'),
('643038bb84', 5, 'PRD', 'ID', 'KOP/KERIK', '', '<p>Selain untuk meredakan masuk angin KOP/KERIK juga bermanfaat untuk meredakan migrain, mengatasi nyeri leher serta membuat tidur lebih nyenyak.</p>', '', 'Kop / Kerik', 'Kop / Kerik', '', '643038bb84.jpg'),
('643039af4f', 5, 'TIM', 'ID', '', '', '', '', '', '', '', '643039af4f.png'),
('643039cf40', 5, 'TIM', 'ID', '', '', '', '', '', '', '', '643039cf40.png'),
('643039e6a1', 5, 'TIM', 'ID', '', '', '', '', '', '', '', '643039e6a1.png'),
('643039f648', 5, 'TIM', 'ID', '', '', '', '', '', '', '', '643039f648.png'),
('64303a1874', 5, 'TIM', 'ID', '', '', '', '', '', '', '', '64303a1874.png'),
('64303a3a5b', 5, 'TIM', 'ID', '', '', '', '', '', '', '', '64303a3a5b.png'),
('6430478131', 4, 'PRD', 'ID', 'WEDDING MANAGEMENT CREW', '', '<p>Dengan crew yang memiliki jam terbang tinggi, UF Enterprise siap untuk mewujudkan resepsi pernikahan para anak muda di Jabodetabek. Mulai dari menata rentetan susunan acara, Proses pemilihan vendor Busana, Rias, Catering, Foto & Video , entertaintment dan lainnya, hingga mengatur jalannya acara dengan sukses di hari H.</p>', '', 'Wedding Management Crew', 'Wedding Management Crew', '', '64304781311fd.png'),
('643047ba3c', 4, 'PRD', 'ID', 'DEKORASI & PELAMINAN', '', '<p>Dekorasi menjadi point penting dalam sebuah pernikahan, UF Enterprise memilki dekorasi dan siap menyesuaikan konsep rancangan para calon pengantin. Tentunya dengan berbagai pilihan budget dan Ukuran.</p>', '<p>Selain Wedding Planner, UF Enterprise juga memiliki Dekorasi Sendiri, Beragam pilihan disediakan dalam memenuhi Wedding Impian para milenials Indonesia.</p>\r\n<p>\"></p>\r\n<p>UF Enterprise menyuguhkan layanan wedding planner untuk para milenials yang ingin menciptakan moment berkesan di acara pernikahannya. Selain di kelola oleh para anak muda, konsep yang disuguhkan adalah konsep wedding modern baik Daerah, Nasional ataupun Internasional.</p>\r\n<p>UF Enterprise sendiri berdiri sejak  13 Juni 2021, oleh Fedri Ramadhan (Uda Fe). Selama beberapa tahun berdiri, UF Enterprise telah melayani ratusan Client Wedding, di berbagai daerah di JABODETABEK. Selain itu UF Enteprise hadir dengan konsep \"Custom My Wedding\", artinya pasang muda tidak perlu khawatir lagi kekurangan budget untuk pernikahannya, karena UF Enteprise akan membantu mengcreate acara Pernikahan client based on budget client, tanpa mengurangi ke professionalan para Wedding Planner di UF Enteprise.</p>\r\n<p>Selain Wedding Planner, UF Enterprise juga memiliki Dekorasi Sendiri, Beragam pilihan disediakan dalam memenuhi Wedding Impian para milenials Indonesia.</p>', 'Dekorasi & Pelaminan', 'Dekorasi & Pelaminan', '', '643047ba3c17e.png'),
('643047f8a6', 4, 'TIM', 'ID', '', '', '', '', '', '', '', '643047f8a6c59.png'),
('643048046d', 4, 'TIM', 'ID', '', '', '', '', '', '', '', '643048046dad8.png'),
('6430481635', 4, 'TIM', 'ID', '', '', '', '', '', '', '', '643048163552d.png'),
('64304825de', 4, 'TIM', 'ID', '', '', '', '', '', '', '', '64304825de023.png'),
('6430484810', 4, 'TIM', 'ID', '', '', '', '', '', '', '', '6430484810308.png'),
('6430486590', 4, 'TIM', 'ID', '', '', '', '', '', '', '', '6430486590fad.png'),
('64304b92b9', 4, 'ABT', 'ID', 'UF Enterprise', '', '<p>Merupakan sebuah merk dagang dari PT. Mantiko Alam Indonesia yang memberikan layanan penuh untuk membantu, mengatur, dan mempersiapkan acara lamaran, akad, hingga resepsi pernikahan.</p>\r\n<p>Wedding Organizer kami bekerjasama dengan vendor-vendor yang professional di bidangnya dan crew WO yang sudah berpengalaman</p>\r\n<p> </p>', '<p>UF Enterprise menyuguhkan layanan wedding planner untuk para milenials yang ingin menciptakan moment berkesan di acara pernikahannya. Selain di kelola oleh para anak muda, konsep yang disuguhkan adalah konsep wedding modern baik Daerah, Nasional ataupun Internasional.</p>\r\n<p>UF Enterprise sendiri berdiri sejak  13 Juni 2021, oleh Fedri Ramadhan (Uda Fe). Selama beberapa tahun berdiri, UF Enterprise telah melayani ratusan Client Wedding, di berbagai daerah di JABODETABEK. Selain itu UF Enteprise hadir dengan konsep \"Custom My Wedding\", artinya pasang muda tidak perlu khawatir lagi kekurangan budget untuk pernikahannya, karena UF Enteprise akan membantu mengcreate acara Pernikahan client based on budget client, tanpa mengurangi ke professionalan para Wedding Planner di UF Enteprise.</p>\r\n<p>Selain Wedding Planner, UF Enterprise juga memiliki Dekorasi Sendiri, Beragam pilihan disediakan dalam memenuhi Wedding Impian para milenials Indonesia.</p>', 'UF Enterprise', 'UF Enterprise', '', '64304b92b9ddb.png'),
('6431c79cac', 3, 'PRD', 'ID', 'MOTIVATOR', '', '<p>Motivator MGI akan memberikan pelatihan yang bertujuan untuk pengembangan diri, meningkatkan motivasi dalam diri, saling kerjasama, saling membantu. Dan berbagai macam hal-hal positif yang membawa dampak baik untuk peserta training.</p>', '', 'MOTIVATOR', 'MOTIVATOR', '', '6431c79cac869.png'),
('6431cf4e21', 6, 'ABT', 'ID', 'D\'KAPAU NUSANTARA', '', '<p>DKapau Nusantara mulai beroperasi sejak pertengahan tahun 2020. </p>\r\n<p>Restoran khas Minangkabau Sumatera Barat ini awalnya hanya rumah makan yang melayani makan dine-in dan take away saja,</p>\r\n<p>namun berdasarkan banyaknya permintaan customer terhadap pemesanan lunch/dinner box dalam jumlah banyak, DKapau semakin berkembang dan saat ini sudah melayani lunch/dinner box, snack box, rendang box, dan jasa catering buffee/prasmanan.</p>', '', 'D\'KAPAU NUSANTARA', 'D\'KAPAU NUSANTARA', '', '6431cf4e211c3.png'),
('64331a66c4', 6, 'PRD', 'ID', 'LUNCH / DINNER  BOX', '', '<p>Seiring banyaknya pemesanan dari customer kini kami menyediakan lunch / dinner box bisa untuk pemesanan dalam jumlah banyak seperti untuk kegiatan workshop, seminar dan acara sosial lainnya</p>', '', 'LUNCH BOX', 'LUNCH BOX', '', '64331a66c4.jpg'),
('64331abbb8', 6, 'PRD', 'ID', 'BUFFEE / PRASMANAN', '', '<p>Kami menawarkan buffee / prasmanan untuk kegiatan workshop, seminar, acara pernikahan, dll.</p>', '', 'Paket Buffee Prasmanan', 'Paket Buffee Prasmanan', '', '64331abbb8.jpg'),
('64331b01e6', 6, 'PRD', 'ID', 'SNACK BOX', '', '<p>Kami menyediakan snack box bisa untuk pemesanan dalam jumlah banyak seperti untuk kegiatan workshop, seminar dan acara sosial lainnya.</p>', '', 'SNACK BOX', 'SNACK BOX', '', '64331b01e6.jpg'),
