(207, 'theme_mods_payfresh', 'a:157:{i:0;b:0;s:18:\"nav_menu_locations\";a:0:{}s:18:\"custom_css_post_id\";i:116;s:26:\"payfresh_lp_header_tagline\";s:34:\"<strong>We Pay Your Bills</strong>\";s:30:\"payfresh_lp_header_description\";s:209:\"Struggling to keep up with your bills? Let PayFresh take care of it. We will pay your pending bills, giving you the time you need, to get your finances in order. Don\'t let unpaid bills stress you. Apply today!\";s:24:\"payfresh_lp_header_image\";s:0:\"\";s:27:\"payfresh_lp_header_tagline1\";s:6:\"We Pay\";s:27:\"payfresh_lp_header_tagline2\";s:10:\"Your Bills\";s:21:\"payfresh_stat_title_1\";s:3:\"400\";s:27:\"payfresh_stat_description_1\";s:31:\"PayFresh active users until now\";s:21:\"payfresh_stat_title_2\";s:3:\"4.5\";s:27:\"payfresh_stat_description_2\";s:28:\"PayFresh score on Trustpilot\";s:21:\"payfresh_stat_title_3\";s:3:\"100\";s:27:\"payfresh_stat_description_3\";s:29:\"PayFresh Payment success rate\";s:21:\"payfresh_stat_title_4\";s:2:\"80\";s:27:\"payfresh_stat_description_4\";s:34:\"PayFresh partners around the world\";s:23:\"payfresh_section3_image\";s:70:\"http://localhost/payfresh/wp-content/uploads/2023/04/section-3-fig.png\";s:23:\"payfresh_section3_title\";s:16:\"We buy you time!\";s:31:\"payfresh_section3_description_1\";s:305:\"Don\'t worry, you\'re not alone! Research shows that many people in Switzerland struggle with unexpected expenses and find themselves in financial trouble, despite careful planning. Overdue payments to utility companies and increasing debts from reminders and enforcement fees make the situation even worse.\";s:31:\"payfresh_section3_description_2\";s:99:\"With PayFresh, you no longer need to worry about delayed payments and the hassle of managing bills.\";s:31:\"payfresh_section3_description_3\";s:137:\"Because your financial well-being is our top priority, we understand your situation and are here to support you. With our help, you can :\";s:36:\"payfresh_section3_description_card_1\";s:45:\"Pay your bills and recurring payments on time\";s:36:\"payfresh_section3_description_card_2\";s:42:\"Avoid interest and fines for late payments\";s:36:\"payfresh_section3_description_card_3\";s:24:\"Meet unexpected expenses\";s:36:\"payfresh_section3_description_card_4\";s:28:\"Prevent financial incapacity\";s:23:\"payfresh_section4_title\";s:13:\"Why choose us\";s:26:\"payfresh_section4_subtitle\";s:119:\"We don\'t make empty promises - we pride ourselves on delivering on our commitments and providing value to our customers\";s:30:\"payfresh_section4_title_card_1\";s:50:\"Everyone gets a chance, no matter the credit score\";s:28:\"payfresh_section4_card_img_1\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-1.png\";s:30:\"payfresh_section4_title_card_2\";s:43:\"Easy application process and quick approval\";s:28:\"payfresh_section4_card_img_2\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-2.png\";s:30:\"payfresh_section4_card_title_3\";s:62:\"Dashboard makes it simple and easy to monitor and manage bills\";s:28:\"payfresh_section4_card_img_3\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-3.png\";s:30:\"payfresh_section4_card_title_4\";s:85:\"Immediate payment of open bills - you can start taking control of your finances today\";s:28:\"payfresh_section4_card_img_4\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-4.png\";s:30:\"payfresh_section4_card_title_5\";s:41:\"Flexibility in case of need for more time\";s:28:\"payfresh_section4_card_img_5\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-5.png\";s:30:\"payfresh_section4_card_title_6\";s:36:\"Full transparency and no hidden fees\";s:28:\"payfresh_section4_card_img_6\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-6.png\";s:30:\"payfresh_section4_card_title_7\";s:72:\"No interest on outstanding invoices but only fixed fees for our services\";s:28:\"payfresh_section4_card_img_7\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-7.png\";s:30:\"payfresh_section4_card_title_8\";s:30:\"Free payment reminder - valuta\";s:28:\"payfresh_section4_card_img_8\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/04/img-section4-8.png\";s:30:\"payfresh_section4_title_card_3\";s:62:\"Dashboard makes it simple and easy to monitor and manage bills\";s:30:\"payfresh_section4_title_card_4\";s:85:\"Immediate payment of open bills - you can start taking control of your finances today\";s:30:\"payfresh_section4_title_card_5\";s:41:\"Flexibility in case of need for more time\";s:30:\"payfresh_section4_title_card_6\";s:36:\"Full transparency and no hidden fees\";s:30:\"payfresh_section4_title_card_7\";s:72:\"No interest on outstanding invoices but only fixed fees for our services\";s:30:\"payfresh_section4_title_card_8\";s:30:\"Free payment reminder - valuta\";s:23:\"payfresh_section6_title\";s:26:\"See who\'s talking about us\";s:26:\"payfresh_section6_subtitle\";s:106:\"Being featured in the media reinforces our goal of delivering innovative solutions and exceptional service\";s:37:\"payfresh_section6_description_brand_1\";s:70:\"Payfresh is a cost management software that helps in managing finances\";s:35:\"payfresh_section6_testiname_brand_1\";s:10:\"CNN Europe\";s:37:\"payfresh_section6_description_brand_2\";s:71:\"Payfresh : “Payments can be made easily and quickly for millennial”\";s:35:\"payfresh_section6_testiname_brand_2\";s:8:\"BBC News\";s:37:\"payfresh_section6_description_brand_3\";s:71:\"Payfresh : “Payments can be made easily and quickly for millennial”\";s:35:\"payfresh_section6_testiname_brand_3\";s:8:\"BBC News\";s:37:\"payfresh_section6_description_brand_4\";s:204:\"\"Currently, the majority of PayFresh users have taken advantage of this service because many customers are spoiled with various discounts and gifts that are quite tempting and can be exchanged for points\"\";s:35:\"payfresh_section6_testiname_brand_4\";s:8:\"BBC News\";s:23:\"payfresh_section7_title\";s:30:\"Take Control Of Your Finances!\";s:23:\"payfresh_section7_image\";s:70:\"http://localhost/payfresh/wp-content/uploads/2023/07/section-7-img.png\";s:23:\"payfresh_section8_title\";s:17:\"Financial academy\";s:29:\"payfresh_section8_description\";s:905:\"At PayFresh, we believe in empowering our customers to take full control of their finances and achieve their financial goals. That\'s why we are proud to introduce our Financial Academy, a comprehensive resource center designed to provide valuable financial advice and information that fit your needs.\n\n<p>Whether you\'re looking to learn about budgeting, investing, or credit management, our Financial Academy has you covered. Our team of experienced financial experts has created a wealth of educational resources, including articles, videos, and infographics, to help you build your financial knowledge and skills.</p>\n\n<p>Our Financial Academy is just one of the many ways we strive to support our customers on their financial journeys. Start exploring our Financial Academy today and take the first step towards a brighter financial future. Create a free account and get access to our services now.</p>\";s:23:\"payfresh_section8_image\";s:70:\"http://localhost/payfresh/wp-content/uploads/2023/07/section-8-img.png\";s:23:\"payfresh_section8_total\";s:3:\"400\";s:22:\"payfresh_section8_ava1\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/04/user-testi-1.png\";s:22:\"payfresh_section8_ava2\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/04/user-testi-2.png\";s:22:\"payfresh_section8_ava3\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/04/user-testi-3.png\";s:22:\"payfresh_section8_ava4\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/04/user-testi-4.png\";s:23:\"payfresh_section9_title\";s:12:\"Our partners\";s:26:\"payfresh_section9_subtitle\";s:91:\"Discover the best benefits from our trusted partners to facilitate all your financial needs\";s:29:\"payfresh_section9_brand_name1\";s:10:\"Mastercard\";s:36:\"payfresh_section9_brand_description1\";s:72:\"Mastercard is a market leading card scheme worldwide &amp; multinational\";s:29:\"payfresh_section9_brand_name2\";s:4:\"Visa\";s:36:\"payfresh_section9_brand_description2\";s:73:\"Visa is the largest global card network in the world by transaction value\";s:29:\"payfresh_section9_brand_name3\";s:6:\"PayPal\";s:36:\"payfresh_section9_brand_description3\";s:92:\"PayPal is a trusted digital wallet, with over 300 million active users in over 200 countries\";s:29:\"payfresh_section9_brand_name4\";s:6:\"Sofort\";s:36:\"payfresh_section9_brand_description4\";s:75:\"Sofort is a popular online banking payment method in Europe with high usage\";s:29:\"payfresh_section9_brand_name5\";s:16:\"American Express\";s:36:\"payfresh_section9_brand_description5\";s:74:\"American Express is a global payments company that primarily offers credit\";s:29:\"payfresh_section9_brand_name6\";s:11:\"PostFinance\";s:36:\"payfresh_section9_brand_description6\";s:68:\"PostFinance provides innovative and comprehensive financial services\";s:29:\"payfresh_section9_brand_name7\";s:5:\"Adyen\";s:36:\"payfresh_section9_brand_description7\";s:84:\"Adyen is an end-to-end payments, data, and financial management in a single solution\";s:29:\"payfresh_section9_brand_name8\";s:24:\"Swiss Financial Partners\";s:36:\"payfresh_section9_brand_description8\";s:85:\"Swiss Financial Partners SA works with leading Swiss banks offering excellent pricing\";s:24:\"payfresh_section10_title\";s:13:\"PayFresh blog\";s:27:\"payfresh_section10_subtitle\";s:81:\"Get the latest financial news and update from around the world from PayFresh blog\";s:30:\"payfresh_section10_blog_image1\";s:63:\"http://localhost/payfresh/wp-content/uploads/2023/05/blog-1.png\";s:36:\"payfresh_section10_blog_description1\";s:70:\"The top 5 Mistakes you should avoid when selecting a financial planner\";s:30:\"payfresh_section10_blog_image2\";s:63:\"http://localhost/payfresh/wp-content/uploads/2023/05/blog-2.png\";s:36:\"payfresh_section10_blog_description2\";s:55:\"Ways to improve the way you save money before Christmas\";s:30:\"payfresh_section10_blog_image3\";s:63:\"http://localhost/payfresh/wp-content/uploads/2023/05/blog-3.png\";s:36:\"payfresh_section10_blog_description3\";s:66:\"Believing these three myths actually keeps your credit score lower\";s:30:\"payfresh_section10_blog_image4\";s:63:\"http://localhost/payfresh/wp-content/uploads/2023/05/blog-4.png\";s:36:\"payfresh_section10_blog_description4\";s:54:\"Three things you didn\'t know about retirement accounts\";s:30:\"payfresh_section10_blog_image5\";s:63:\"http://localhost/payfresh/wp-content/uploads/2023/05/blog-4.png\";s:36:\"payfresh_section10_blog_description5\";s:54:\"Three things you didn\'t know about retirement accounts\";s:11:\"custom_logo\";i:78;s:29:\"payfresh_section6_brand_img_1\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Media-3.png\";s:29:\"payfresh_section6_brand_img_2\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Media-4.png\";s:29:\"payfresh_section6_brand_img_3\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Media-4.png\";s:29:\"payfresh_section6_brand_img_4\";s:69:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Media-4.png\";s:30:\"payfresh_section9_brand_image1\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Partner-1.png\";s:30:\"payfresh_section9_brand_image2\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Partner-2.png\";s:30:\"payfresh_section9_brand_image3\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Partner-3.png\";s:30:\"payfresh_section9_brand_image4\";s:71:\"http://localhost/payfresh/wp-content/uploads/2023/05/Logo-Partner-4.png\";s:30:\"payfresh_section9_brand_image5\";s:71:\"http://localhost/payfresh/wp-content/uploads/