(186, 1, '2023-07-22 23:43:31', '2023-07-22 23:43:31', '<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">The PayFresh story</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>2022 - In the heart of Switzerland, a fintech startup with a mission to change the way people think about finances was born.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It all began with a simple idea in 2014: to offer a more practical and accessible solution for managing finances. Our unique approach to mini loans involves paying open invoices, rather than providing direct loans, helping individuals overcome financial stress and reach their goals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In the early days, our team of dedicated professionals worked tirelessly to bring our vision to life. We understood the challenges faced by people in managing their finances and were determined to offer a solution that would make a real impact.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Shaping the future of financial empowerment: the Payfresh vision</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>From the very beginning, our goal was to offer a solution that goes beyond just paying open invoices. We want to help people overcome financial stress, educate them on how to better manage their finances, and empower them to reach financial freedom. Our commitment to excellence, transparency, and responsible lending practices is at the heart of everything we do.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As we look to the future, we are eager to continue expanding our reach and making a positive impact on the world of finance. Our commitment to excellence, transparency, and responsible lending practices remains at the forefront of everything we do, and we are dedicated to helping our clients achieve financial freedom. In the coming years, we plan to further develop our partnerships with entities like utility providers in the B2B sector, as well as expanding our services to reach even more people in need.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Join us on our journey towards a future where financial well-being is within reach for everyone. With our innovative solutions and unwavering commitment to our clients, we are confident that we can make a real difference in peoples lives.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">Join Payfresh ></a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->\n\n<!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"wp-block-heading has-text-align-center\">PayFresh values and compliance</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">At Payfresh, we are guided by a set of core values that define who we are and what we stand for. These values are at the heart of everything we do, and they serve as the foundation for our continued growth and success. Our values include:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">By embracing these values and continuously striving to live up to them, Payfresh is building a strong foundation for continued success and growth. We are committed to making a positive impact on the world of finance, and we believe that our values and compliance standards are integral to achieving this goal.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textAlign\":\"right\"} -->\n<h2 class=\"wp-block-heading has-text-align-right\">Give value with positive impact</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">At Payfresh, we are committed to making a positive impact and contributing to a greater cause. To support our ESG values, we donate CHF1 to \"give directly.org\" for each invoice uploaded to our platform.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'About PayFresh', '', 'inherit', 'closed', 'closed', '', '127-revision-v1', '', '', '2023-07-22 23:43:31', '2023-07-22 23:43:31', '', 127, 'http://localhost/payfresh/?p=186', 0, 'revision', '', 0),
