(198, 1, '2023-07-23 04:38:34', '2023-07-23 04:38:34', '<!-- wp:paragraph -->\n<p>The Payfresh team is made up of a talented and diverse group of finance, technology, and compliance professionals, who are dedicated to helping people achieve financial freedom. With a passion for innovation and a commitment to ethical business practices, our team provides a comprehensive and well-rounded approach to mini loan services.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our finance professionals bring a deep understanding of the industry and a commitment to responsible lending practices. Our technology experts are constantly exploring new and creative solutions to meet the evolving needs of our clients. Our compliance professionals ensure that all relevant regulations and laws are followed and that our clients are fully informed and protected throughout the loan process.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Payfresh, we believe in the power of collaboration and teamwork. With a team of highly skilled and motivated individuals working together towards a common goal, we are confident that we can continue to make a positive impact on the world of finance for years to come.</p>\n<!-- /wp:paragraph -->', 'The Payfresh family', '', 'publish', 'closed', 'closed', '', 'the-payfresh-family', '', '', '2023-07-24 17:40:46', '2023-07-24 17:40:46', '', 0, 'http://localhost/payfresh/?post_type=about&#038;p=198', 0, 'about', '', 0),
