(248, 1, '2023-07-24 17:31:29', '2023-07-24 17:31:29', '<!-- wp:paragraph -->\n<p>At Payfresh, we are committed to making a positive impact and contributing to a greater cause. To support our ESG values, we donate CHF1 to \"give directly.org\" for each invoice uploaded to our platform.</p>\n<!-- /wp:paragraph -->', 'Give value with positive impact', '', 'publish', 'closed', 'closed', '', 'give-value-with-positive-impact', '', '', '2023-07-24 17:37:13', '2023-07-24 17:37:13', '', 0, 'http://localhost/payfresh/?post_type=about&#038;p=248', 0, 'about', '', 0),
