(253, 1, '2023-07-24 18:07:22', '2023-07-24 18:07:22', '<!-- wp:paragraph -->\n<p>We understand that in the case of unexpected expenses, keeping up with all of the monthly bills can be challenging. That\'s why we offer you the possibility to stay flexible in case of shortages. We don\'t just lend you money, we also allow you to take a breath and make the right decisions by paying your open bills easily and comfortably.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are a mini credit platform, offering you monthly loans up to CHF 499.00. However, instead of giving you cash, we pay your bills and give you 30 days to repay us. This helps you to keep a good credit score and takes away the anxiety of upcoming reminders or even debt collection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our application process is quick and straightforward, so you can start taking control of your finances today.</p>\n<!-- /wp:paragraph -->', 'How Payfresh works', '', 'inherit', 'closed', 'closed', '', '252-revision-v1', '', '', '2023-07-24 18:07:22', '2023-07-24 18:07:22', '', 252, 'http://localhost/payfresh/?p=253', 0, 'revision', '', 0),
