(337, 1, '2023-07-30 00:14:46', '2023-07-30 00:14:46', '<!-- wp:paragraph -->\n<p>2022 - Im Herzen der Schweiz wurde ein Fintech-Startup gegründet, das sich zum Ziel gesetzt hat, die Art und Weise, wie Menschen über Finanzen denken, zu verändern. Alles begann mit einer einfachen Idee im Jahr 2014: eine praktischere und leichter zugängliche Lösung für die Bewältigung von finanziellen Herausforderungen anzubieten. Unser einzigartiger Ansatz für Minikredite besteht darin, offene Rechnungen zu bezahlen, anstatt direkte Kredite zu gewähren, und so den Menschen zu helfen, finanziellen Stress zu überwinden und ihre Ziele zu erreichen. So arbeitete unser Team von Experten von Anfang an unermüdlich daran, unsere Vision in die Tat umzusetzen. Wir haben die Herausforderungen verstanden, mit denen unsere Kunden bei der Bewältigung ihrer Finanzen konfrontiert sind, und waren entschlossen, eine Lösung anzubieten, die wirklich etwas bewirken würde.</p>\n<!-- /wp:paragraph -->', 'Die Payfresh-Story', '', 'publish', 'closed', 'closed', '', 'die-payfresh-story', '', '', '2023-07-30 08:48:31', '2023-07-30 08:48:31', '', 0, 'http://localhost/payfresh/?post_type=about&#038;p=337', 0, 'about', '', 0),
(338, 1, '2023-07-30 00:14:46', '2023-07-30 00:14:46', '<!-- wp:paragraph -->\n<p>2022 - Im Herzen der Schweiz wurde ein Fintech-Startup gegründet, das sich zum Ziel gesetzt hat, die Art und Weise, wie Menschen über Finanzen denken, zu verändern. Alles begann mit einer einfachen Idee im Jahr 2014: eine praktischere und leichter zugängliche Lösung für die Bewältigung von finanziellen Herausforderungen anzubieten. Unser einzigartiger Ansatz für Minikredite besteht darin, offene Rechnungen zu bezahlen, anstatt direkte Kredite zu gewähren, und so den Menschen zu helfen, finanziellen Stress zu überwinden und ihre Ziele zu erreichen. So arbeitete unser Team von Experten von Anfang an unermüdlich daran, unsere Vision in die Tat umzusetzen. Wir haben die Herausforderungen verstanden, mit denen unsere Kunden bei der Bewältigung ihrer Finanzen konfrontiert sind, und waren entschlossen, eine Lösung anzubieten, die wirklich etwas bewirken würde.</p>\n<!-- /wp:paragraph -->', 'Die Payfresh-Story', '', 'inherit', 'closed', 'closed', '', '337-revision-v1', '', '', '2023-07-30 00:14:46', '2023-07-30 00:14:46', '', 337, 'http://localhost/payfresh/?p=338', 0, 'revision', '', 0),
(339, 1, '2023-07-30 00:17:47', '2023-07-30 00:17:47', '<!-- wp:paragraph -->\n<p>Wir wissen, dass es im Falle unerwarteter Ausgaben schwierig sein kann, alle monatlichen Rechnungen zu begleichen. Deshalb bieten wir Dir die Möglichkeit, bei Engpässen flexibel zu bleiben. Wir gewähren Dir nicht nur einen Kredit, sondern geben Dir auch die Möglichkeit, durchzuatmen und die richtigen Entscheidungen zu treffen, indem wir Deine offenen Rechnungen einfach und bequem bezahlen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wir sind eine Mini-Kreditplattform, die Dir monatliche Kredite bis zu CHF 499.00 anbietet. Allerdings geben wir Dir kein Bargeld, sondern bezahlen Deine Rechnungen und geben Dir 30 Tage Zeit für die Rückzahlung. Das hilft Dir, eine gute Kreditwürdigkeit zu behalten und nimmt Dir die Angst vor Mahnungen oder gar Inkasso.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Unser Anmeldeverfahren ist schnell und unkompliziert, so dass Du noch heute damit beginnen kannst, die Kontrolle über Deine Finanzen zu übernehmen.</p>\n<!-- /wp:paragraph -->', 'Wie es funktioniert', '', 'publish', 'closed', 'closed', '', 'wie-es-funktioniert', '', '', '2023-07-30 00:17:47', '2023-07-30 00:17:47', '', 0, 'http://localhost/payfresh/?post_type=howitwork&#038;p=339', 0, 'howitwork', '', 0),
(340, 1, '2023-07-30 00:17:47', '2023-07-30 00:17:47', '<!-- wp:paragraph -->\n<p>Wir wissen, dass es im Falle unerwarteter Ausgaben schwierig sein kann, alle monatlichen Rechnungen zu begleichen. Deshalb bieten wir Dir die Möglichkeit, bei Engpässen flexibel zu bleiben. Wir gewähren Dir nicht nur einen Kredit, sondern geben Dir auch die Möglichkeit, durchzuatmen und die richtigen Entscheidungen zu treffen, indem wir Deine offenen Rechnungen einfach und bequem bezahlen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wir sind eine Mini-Kreditplattform, die Dir monatliche Kredite bis zu CHF 499.00 anbietet. Allerdings geben wir Dir kein Bargeld, sondern bezahlen Deine Rechnungen und geben Dir 30 Tage Zeit für die Rückzahlung. Das hilft Dir, eine gute Kreditwürdigkeit zu behalten und nimmt Dir die Angst vor Mahnungen oder gar Inkasso.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Unser Anmeldeverfahren ist schnell und unkompliziert, so dass Du noch heute damit beginnen kannst, die Kontrolle über Deine Finanzen zu übernehmen.</p>\n<!-- /wp:paragraph -->', 'Wie es funktioniert', '', 'inherit', 'closed', 'closed', '', '339-revision-v1', '', '', '2023-07-30 00:17:47', '2023-07-30 00:17:47', '', 339, 'http://localhost/payfresh/?p=340', 0, 'revision', '', 0),
