(376, 1, '2023-08-18 01:21:55', '2023-08-18 01:21:55', '<!-- wp:paragraph -->\n<p>Why do I need to do the KYC onboarding process?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As a financial intermediary in Switzerland, we are obligated to identify all customers according to FINMA (Swiss Financial Market Supervisory Authority) regulations. PayFresh is taking those KYC (Know Your Customer) regulations seriously, to protect our clients and maintain a safe and secure platform.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>KYC is all about verifying who you are and making sure that the information you provide us with is accurate. This helps us prevent any criminal activity from occurring and keeps our platform secure. When you use our services, you\'ll be asked to provide some basic information, such as your full name, date of birth, and address. Afterwards, we\'ll carefully verify and confirm this information by using a method specified and recommended by the FINMA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Don\'t worry, the process is quick and simple, and all of your information is kept confidential and secure. By following KYC regulations, we\'re able to offer you the best possible lending experience and make sure that our platform is a safe and trustworthy place for you to handle your bills.</p>\n<!-- /wp:paragraph -->', 'Payfresh anti-money laundering - KYC Explanation', '', 'publish', 'closed', 'closed', '', 'payfresh-anti-money-laundering-kyc-explanation', '', '', '2023-08-18 01:21:55', '2023-08-18 01:21:55', '', 0, 'http://localhost/payfresh/?post_type=kyc&#038;p=376', 0, 'kyc', '', 0),
(377, 1, '2023-08-18 01:21:55', '2023-08-18 01:21:55', '<!-- wp:paragraph -->\n<p>Why do I need to do the KYC onboarding process?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As a financial intermediary in Switzerland, we are obligated to identify all customers according to FINMA (Swiss Financial Market Supervisory Authority) regulations. PayFresh is taking those KYC (Know Your Customer) regulations seriously, to protect our clients and maintain a safe and secure platform.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>KYC is all about verifying who you are and making sure that the information you provide us with is accurate. This helps us prevent any criminal activity from occurring and keeps our platform secure. When you use our services, you\'ll be asked to provide some basic information, such as your full name, date of birth, and address. Afterwards, we\'ll carefully verify and confirm this information by using a method specified and recommended by the FINMA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Don\'t worry, the process is quick and simple, and all of your information is kept confidential and secure. By following KYC regulations, we\'re able to offer you the best possible lending experience and make sure that our platform is a safe and trustworthy place for you to handle your bills.</p>\n<!-- /wp:paragraph -->', 'Payfresh anti-money laundering - KYC Explanation', '', 'inherit', 'closed', 'closed', '', '376-revision-v1', '', '', '2023-08-18 01:21:55', '2023-08-18 01:21:55', '', 376, 'http://localhost/payfresh/?p=377', 0, 'revision', '', 0),
