('62a08fa1d0', 'APA ITU KALMER?', '', 'Kami adalah perusahaan yang bergerak dibidang jasa kontraktor bangunan tempat tinggal (Rumah, Apartemen). Kami menyediakan jasa Bangun Baru, Renovasi, Interior, Exterior dan lain-lain. Kami adalah solusi terbaik dalam menangani tempat tinggal anda.', 'Hubungi Kami', 'https://wa.me/6281318135343?text=Halo+!+Saya+tertarik+untuk+menggunakan+jasa+PT+Kalmer+Multi+Teknik', '62a08fa1d0c1d.jpg');
INSERT INTO `article` (`article_id`, `title`, `description`, `start_date`, `end_date`, `author`, `category`, `tags`, `image`, `meta`) VALUES
('62a12bbfa8', 'Penggunaan Elektronik Dalam Satu Rumah', 'Alat elektronik juga dipahami sebagai peralatan yang memudahkan pekerjaan manusia dan menggunakan prinsip elektronika.\r\nSetiap rumah memiliki alat elektronik yang berbeda-beda sesuai dengan kebutuhannya.\r\nAlat Elektronik yang Ada di Rumah serta Kegunaannya\r\nBerikut alat alat listriknya.\r\n1. kulkas\r\nTanpa kulkas atau lemari es, tentunya makanan akan menjadi mudah busuk karena tak bisa disimpan dalam waktu lama. Oleh karena itu, kegunaannya dalam mengawetkan makanan inilah, kulkas menjadi salah satu penemuan yang mengubah dunia dalam sejarah makanan. \r\nKulkas adalah lemari pendingin yang dibuat dengan mfenciptakan kondisi pendinginan dan menghilangkan suhu panas. \r\nPengawetan makanan dengan pendingan telah ada selama ribuan tahun, namun lemari es modern sendiri adalah penemuan baru, penemuan model pendingin buatan pertama, yang kemudian di kenal sebagai kulkas, ditemukan oleh William Cullen, seorang dokter skotlandia yang mengamati bahwa penguapan memiliki efek pendinginan pada tahun 1720-an.\r\nIlmuan inggris, Michael faraday juga melakukan upaya yang sama pada tahun 1834, Jacob perkins yang membuat mesin pendingin praktis menggunakan sistem kompresi uap eter pada tahun 1835 dan mematenkan penemuannya.\r\nKulkas 2 pintu membutuhkan supply listrik antara 100-115 watt atau 115-171 watt, kulkas ini memiliki kapasitas penyinpanan mulai dari 210-230 liter atau 300-700 liter.\r\n\r\n2. AC\r\nPada tahun 2januari 1906, paten untuk alat penyejuk udara atau air conditioning [AC] di berikan kepada willis haviland carrier. Insinyur asal amerika serikat itu menemukan mesin tersebut secara tak sengaja. Empat tahun sebelumnya, pada 1902, carrier baru lulus cornell university. Nah sekarang air conditioning  bisa kita gunakan di masa kini berkat carrier atau di sebut juga dengan AC  yang sekarang kita gunakan,  pendingin ruangan, penyaman udara, erkon, merupakan sistem mesin yang di rancang untuk menstabilkan suhu udara dan kelembapan suatu area, biasanya AC konvensional 1 pk rata rata membutuhkan daya sekitar 819 watt.  \r\n3. Televisi\r\nPada tahun 1927, T. Farnsworth ilmuan asal Utah, amerika serikat berhasil mengembangkan televisi modern pertama pada saat umur 21 tahun. Gagasannya tentang image dissector tube menjadi dasar kerja televisi. Pada tahun 1929, Vladimir Zworykin dari rusia menyempurnakan tabung katoda yang di namakan kinescope, yang sekarang kita kenal dengan TV atau televisi.  Televisi memiliki kegunaan sebagai sarana hiburan dan menyampaikan informasi melalui gambar dan suara , daya yang di gunakan televisi biasanya berada di angka 100 watt.\r\n4. Blender\r\n Stephen poplawski diakui sebagai penemu blender pada tahun 1922. Poplawski adalah orang pertama yang menempatkan pisau berputar di dasar container/kemasan. Tahun 1932, poplawski menerima paten untuk sebuah mesin yang memperkecil buah buahan dan sayur sayuran menjadi cairan, blender merupakan salah satu peralatan elektronik dapur  yang wajib dimiliki di setiap rumah. Seperti namanya, blender merupakan  alat untuk menghaluskan atau melumatkan bahan makanan,  biasanya memiliki daya konsumsi 130 watt.\r\n\r\n5.penanak nasi/ rice cooker\r\n   Rice cooker pertama kali di temukan oleh Yoshitada minami. Pada tahun 1937, tentara jepang mulai menjalankan prinsip kerja perangkat penanak nasi bertenaga listrik tersebut. Awalnya rice cooker yang digunakan terdiridari wadah kayu tahan bocor dan lempengan logam bertenaga listrik, nah yang sekarang ini kita kenal dengan rice cooker atau penanak nasi yang berfungsi untuk memasak nasi, orang orang hanya perlu memasak nasi dengan cara mencampurkan beras dan air ke wadah atau panci rice cooker, selanjutnya tinggal menekan tombol memasak nasi, biasanya memiliki daya 300 watt dan kemungkinan lebih  kecil ketika sedang menghangatkan nasi dan juga bisa di gunakan untuk menghangatkan makanan lainnya. \r\n6. Mesin Cuci\r\n Eksperimen dengan  berbagai mekanisme pencucian pakaian berlangsung  secara sporadis selama abad ke-19. Pencucian pakaian , hingga pada 1767, ilmuan jerman bernama Jacob Christian schaffer menemukan mesin cuci. Mesin cuci dulu masih bterdiri tangki kayu dan tuas pemutar kayu, cara kerja dengan menuangkan air panas ke dalam tangki, memutar tuas untuk mencuci pakaian, dan kemudian memerasnya di antara dua rol kayu. Tangki mesin cuci kemuadian di keringkan dengan cara membuka kerannya, 30 tahun kemudian se orang pembisnis dari amerika serikat, Nathaniel briggs, memperoleh hak paten pertama untuk mesin cuci. Tenaga listrik mesin cuci bertenaga listrik baru di temukan  pada tahun 1920-an mesin cuci elektrik yang di kendalikan secara manual di pasarkan , biasanya mesin cuci 2 tabung memiliki daya 90-230 watt untuk proses mencuci. Sementara, untuk proses pengeringan membutuhkan daya sebesar 40-130 watt. Daya listrik atau watt yang semakin rendah, maka listrik yang di pakai juga semakin irit.\r\n7. lampu\r\nPengembangan lampu pijar sudah di mulai pada abad XIX.sejarah lampu pijar dapat dikatakan di mulai dengan di temukannya tumpukan volta oleh alessandro volta . pada tahun 1802 sir humphry davy menunjukan bahwa arus listrik dapat memanaskan seuntai logam tipis hingga menyala putih, komponen utama lampu pijar adalah  bola lampu yang terbuat dari kaca, filament, bola lampu, gas pengisi dan kaki lampu. Lampu merupakan suatu teknologi yang di gunakan untuk penerangan terutama ketika keadaan gelap,ruang tidur membutuhkan  cahaya lampu general  sebesar 7-9 watt. Untuk lampu dekoratif berukuran kecil pilih ukuran  6-8 watt. Sedangkan untuk ruang tidur anak  gunakan lampu general sebesar 9-15 watt agar lebih terang.\r\n8. pompa air \r\nPompa air pertama kali ditemuka oleh seorang ilmuan bernama al-jazari pada adab ke- 12 di Mesopotamia. Tahun 1174,al-jazari bekerja sebagai teknisi ahli untuk dinasti artuq, yang ketika itu menjadi penguasa wilayah Mesopotamia. Pompa air tersebut adalah sebuah alat  yang berfungsi untuk mengalirkan air dari dalam tanah ke seluruh keran yang berada di rumah dengan cara menghisap air dari permukaan yang rendah dari permukaan yang tinggi, untuk pompa air normalnya memiliki voltase 250 hingga 500 watt dalam keadaan stabil dan 500 hingga 900 watt pada saat menghisap air.\r\n9. kipas angin\r\nKipas angin  pertama ditemukan lebih kurang 4000 tahun silam pada sebuah makam raja Tutankhamen yang di gali pada tahun 1922. Fungsi dari kipas angina yang di temukan di mesir pada masa itu untuk peralatan upacara keagamaan, sehingga sebuah kipas angin merupakan benda yang sakral, namun kipas angin sekarang bukan hanya sebagai alat ritual melainkan alat elektronik yang bisa di manfaatkan untuk pendingin ruangan. Biasanya konsumsi daya pada kipas angin adalah 103 watt.\r\n10. setrika\r\nSetrika di percaya mulai dikenal dan di gunakan orang sejak tahun 400 SM oleh bangsa yunani. Saat itu, setrika di gunakan untuk membuat lipatan – lipatan vertikal pada pakaian – pakaian kebesaran yang di gunakan untuk melakukan upacara ritual tertentu.\r\nTerdapat banyak manfaat setrika selain untuk merapikan dan menghaluskan pakaian yang kusut, setrika telah menjadi bagian dari perlengkapan rumah tangga modern yang cukup krusial perannya.\r\nKonsumsi daya 300 watt. Asumsi pemakaian 1 jam per hari. Perkiraan biaya pemakaian listrik = Rp 4.500/ bulan.\r\n11. dispenser \r\nDispeser adalah salah satu alat rumah tangga yang menggunakan listrik untuk dapat memanaskan elemen pemanas dan menjalankan mesin pendinginnya.\r\nDispenser ada yang menggunakan prinsip kerja dengan elemen pemanas dan mesin pendingin [compressor]\r\nDispenser di gunakan untuk mendinginkan dan memanaskan air dalam galon ukuran kurang lebih 19 liter, konsumsi daya = menyala 250 watt, standby 6 watt.\r\n12. microwave\r\nSaat ini, microwave sudah menjadi peralatan dapur yang penting karena sangat membantu mempersiapkan atau menghangatkan makanan praktis dan cepat.\r\nDengan berbagai fungsi tambahan. Biasanya, microwave dengan daya yang lebih tinggi biasanya mampu memasak lebih cepat daripada berdaya listrik rendah, idealnya daya yang di butuhkan microwave sekitar 1000 watt untuk bisa berfungsi optimal.\r\n13. blender \r\nBlender adalah penghalus makanan yang menyediakan banyak wadah sehingga bahan makanan yang ingin dihaluskan tidak tercampur, misalnya kamu ingin membuat smoothies untuk bepergian, maka kamu bisa menggunakan wadah berbentuk botol, sedangkan bila ingin menghaluskan bumbu masakan, kamu bisa memakai wadah khusus lainya, blender memiliki daya 130 watt.\r\n14. Vacuum cleaner \r\nVacuum cleaner adalah penghisap debu alat yang menggunakan pompa udara untuk menciptakan keadaan kosong untuk menghisap debu dan kotoran, biasanya dari lantai.\r\nSebagian besar rumah dengan lantai berkarpet di Negara berkembang memiliki penghisap debu sebagai pembersih.\r\nVaccum cleaner tipe satu memiliki daya 1400 watt. \r\n15. speaker \r\nSpeaker yang berfungsi untuk mengeluarkan suara dapat dihubungkan dengan bantuan kabel atau nirkabel ke perangkat elektronik lain seperti televisi atau komputer.\r\nSpeaker yang memiliki 6 inci memiliki daya maksimum 150 watt dengan frekuensi 56 hz hingga 6.3 khz.\r\n16. CD / DVD / MP3 player \r\nBagi mereka yang tak mempunyai pc atau laptop, pemutar cd/mp3 biasa digunakan untuk menyetel musik sedangkan pemutar dvd bisa untuk menonton video atau film.\r\nBanya mreknya ambil saja contohnya LG DVD 5.1 home cinema system 330 watt dengan usb direct reacording dan playback.\r\n', '2022-06-09', '2022-06-30', 'Admin', 'Art', 'elektronik, elektronik rumah', '62a12bbfa8.png', 'penggunaan elektronik dalam rumah'),
('6460967fe3', 'Macam - macam Meval', '<p>1. LED BOHLAM ADVANCE\r\n<br>Kualitas terbaik dengan umur lampu yang jauh lebih lama</p>\r\n\r\n<p>2. LED BOHLAM ECO\r\n<br>Dapat beroperasi dengan tegangan listrik 100V – 240V</p>\r\n\r\n<p>3. LED BOHLAM ECO LV\r\n<br>Dapat beroperasi pada tegangan listrik yang sangat rendah</p>\r\n', '0000-00-00', '0000-00-00', 'Admin', 'Art', 'meval', '6460967fe3a95.png', 'lampu meval');
